"title": "Bourbon Whiskey Reclaimed Wood Box Crate Wall Clock -- Abstract pattern",
"description": "Beautiful, one of kind abstract Bourbon Whiskey Clock Time Piece made from an original repurposed and reclaimed wood and metal frame. Great piece to display over fireplaces, mini bars, game rooms, wine cellars, etc. This time piece captures the heart of aficionados, collectors, and bourbon lovers.  The clock is a wonderful conversation starter as it captures the essence of the Bourbon Whiskey trade.  Hand made with quality craftsmanship with wood from renowned distilleries.  All the details have been carefully considered to details enhance the time piece and provide a Bourbon Whiskey Distillery  feel and context…almost like bringing a piece of a Bourbon Whiskey Distillery right into your home.  \r\n\r\n\r\nThe wood has been carefully preserved to maintain originality, context, and character. Every single piece is one of a kind. No two alike. \r\n\r\n15 1/2   Inches in Diameter -- $178.99\n25 Inches in Diameter -- $278.99\n \r\n\r\n--------------------------------------------------------------------------------\r\nINSPIRATION:\r\n\r\nAfter a few trips to Tennessee and Kentucky, I got  a new appreciation not only for the barrels, but for the Bourbon Whiskey Culture.  To capture the essence of this culture, I found myself working with original materials including reclaimed wood pieces.  These materials tell a story much like the taste of a sip of Bourbon Whisky does.",
