"sale_message": "--&gt;Customers:  Please verify the shipping address on this invoice is correct. We will send an order confirmation via the Etsy Convo System. Please LOG IN to your ETSY account to read it & answer any questions we may have. Thank you so much for your Purchase! We appreciate your business.\r\n\r\n",
