"accepts_custom_requests": true,
"policy_welcome": "Thanks for visiting ScissorMill!\r\n--&gt;Please contact us about production time.\r\n\r\n Our Office Manager, Vontrice, is available online between the hours of 9am-5pm Monday thru Friday. \r\n\r\n**We all have families and enjoy spending time with them on the weekends.\r\n\r\n  RUSH Orders are available but you MUST contact us for approval on your purchase before placing it. \r\n\r\nScissorMill also owns & operates a second store on Etsy called PoppinPrint",
"policy_payment": " --&gt; Our Office Manager Vontrice is available online between the hours of 9am-5pm Monday thru Friday. \r\n\r\n **We all have families and enjoy spending time with them on the weekends.\r\n\r\nRUSH Orders are available but you MUST contact us for approval on your purchase before placing it. \r\n\r\nScissorMill only accepts payment from Etsy Direct Checkout & PayPal. You CAN use your credit card through Paypal - you Don&#39;t Have To Have a Paypal Account.\r\n\r\neCheck Customers:\r\nIf you purchase an item through PayPal and use and eCheck your order will not begin production until after your payment has been cleared. When ordering custom items that require a long production time (up to 25 days) please keep in mind the additional time your order will require for the payment to clear and then the order be made.",
"policy_shipping": "--&gt;Please contact us about production time.\r\n\r\nI use the US Postal Service, Priority Mail for 90% my shipping. USPS guarantees 2-3 day delivery with priority mail. A few orders are shipped with FedEx for specific reasons.\r\n\r\n---&gt;**You have 5 days from the delivery date (per tracking information)  to report broken / missing products. If you are not available to inspect the contents within that time frame, please ask someone to do it for You.**    No Exceptions.   Since glass is so fragile I must put a limit on the amount of time I am liable for any damages.\r\n\r\nIf You receive an order that has been damaged by shipping, please contact me ASAP and I will replace it free of charge as soon as I possibly can. Sending me pictures of the damages is very helpful so I can collect insurance and help pay for the replacement.\r\n\r\n---&gt;If for any reason the address You entered on the invoice was incorrect and Your package is returned to me we will contact You as soon as we can. A private listing will be set up for You to buy the postage a second time with a new shipping address.\r\n\r\n---&gt;Once in a while a package is lost, delivered to the wrong address, or delayed. Your patience and understanding is appreciated. When your package leaves our shop it&#39;s fate is in the hands of the shipping service. We are here for you Monday-Friday 9am-5pm PST. If you have questions about tracking please send us a convo. We are happy to help contact USPS or FedEx to help with the delivery.\r\n\r\n--&gt;You are welcome to pick-up your order from our location. Just ask through the Convo System Before you purchase.",
"policy_refunds": "Before you leave negative feedback I would appreciate the chance to fix, replace, or refund a product if you are not satisfied. It&#39;s very important to me that you enjoy your purchase.  Don&#39;t be afraid to talk with us.\r\n\r\nCustom items are non-returnable.",
"policy_additional": "The products I create are very important to me. It weighs on my conscience when a customer is unhappy with their purchase. I spend a lot of time designing and creating each specific order. If my product makes a positive impression there is a good chance ScissorMill will be recommended to others and keep my business strong. I am constantly aware of this and very grateful for the positive feedback that I receive.\r\n\r\nCOMMUNICATION:\r\nWe contact all customers through the Etsy &quot;Convo&quot; system.\r\n*I cannot stress enough how important it is that you convey every detail you would like to have personalized. We offer designs to choose from - which can all be altered (within reason) to fit your need. However, never assume I &quot;would know&quot; how you want it. It is always best to send us a convo through Etsy to verify we can make what you need.\r\nPublic listings do not receive a proof before production.\r\n\r\nCUSTOMER RESPONSIBILITIES:\r\n-  Slow down and Read my Listing Descriptions & Policies before you purchase.\r\n- Log into Etsy to access your Convos for confirmation, questions & updates\r\n- Communicate with us through the Etsy Convo system\r\n- Read your order confirmation Convo with shipping date (these are sent within 48 hours of every order that is placed)\r\n- Read & Abide by my shipping Policies\r\n- Verify the shipping address is correct - YOU are responsible for making sure we receive the correct address to which you want your package sent.\r\n- For Custom/Private Listings: If you approve the proof we send - that is exactly how your item will be made - regardless of previous conversations. You must take the time to proof-read them and point out the errors if you find any.\r\n- Understand that you are ordering CUSTOM products. Each one is designed and produced individually. **This takes time**\r\n\r\n",
