"description": "Customize your Mini Liquor Bottles! Add custom labels to mini liquor bottles for your next party, wedding, or event! This item can be ordered with the labels only or with the labels and empty bottles. Want this customized for a different occasion or in a different way? Just contact us and we would be happy to create a custom listing for you.\n\nFeel free to give us a call with any questions (888) 959-2870 M-F 9am - 5pm Central or send us a convo anytime!\n\nIF YOU CHOOSE THE LABELS ONLY OPTION:\nPurchase your favorite brand of mini bottles and apply our custom labels over the existing ones. \n– Custom labels only (Mini bottles not included)\n– Designed to fit 50 mL Jack Daniels, Captain Morgan, Smirnoff, Southern Comfort, and other brands of airplane bottles.\n– The labels are approximately 3″ wide x 1 7/8″ high.\n– Please compare these dimensions to your liquor bottle labels because bottles and labels may vary.\n– These labels are printed on waterproof vinyl and are cut to fit over the original label.\n– The labels have an adhesive back and apply to the bottle like a sticker.\n\nIF YOU CHOOSE THE LABELS AND ROUND/SQUARE BOTTLES OPTION:\nPurchase a large bottle of your favorite liquor or mix a cocktail, fill the included bottles, and apply the custom labels. \n– Kit includes: custom labels, empty 50 mL plastic bottles, black bottle caps, and a funnel (Liquor not included)\n– The labels are approximately 3″ wide x 1 7/8″ high.\n– Fill the empty mini bottles with the funnel, secure tamper-evident caps, and apply the custom labels.\n– The labels have an adhesive back and apply to the bottle like a sticker.\n– The empty 50 mL bottles are available in round or square.\n\nTO ORDER:\nPlease send us the following information:\n- Birthday Person&#39;s Full Name\n- Birthday they are celebrating\n- Date\n- Background Color Choice (Black in the photo)\n- After checkout, please send a convo to us with the photo you would like to use attached\n\nThe colors displayed on your monitor may be slightly different from the actual label.\n\nKEEP SHOPPING:\nhttp://www.etsy.com/shop/LiquidCourage\nhttp://liquidcourageflasks.com\n\nVINETTA MAE:\nBe sure to check out our other Etsy shop, Vinetta Mae! It is a monogram boutique with a full lineup of custom phone cases, canvases, prints, signs, and more! \nhttp://www.etsy.com/shop/VinettaMae\n\nThank you for visiting Liquid Courage!\nTyler & Amy Fisk",
