"title": "Handmade flasks to match every personality!",
"announcement": "Welcome to Liquid Courage Flasks! We print our designs on high quality vinyl for durability - NOT scrapbook paper and mod podge! Personalize any flask in our shop with your name, initials, or picture. Convo us or call us at (888) 959-2870 with any questions.\r\n\r\nBe sure to sign up for our newsletter to stay up to date with our latest designs, discounts, and giveaways!\r\n\r\nNEWSLETTER SIGNUP LINK:\r\nhttp://eepurl.com/FP_fT",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Thank you for visiting Liquid Courage!  We specialize in flasks to match every personality.  All flasks are now available in your choice if 8 oz, 6 oz, or 4 oz sizes for the same low price.  Don&#39;t see what you are looking for, have your own idea or image, or want multiples of certain designs?  Convo us for a custom listing.",
"sale_message": "Thank you for your purchase from Liquid Courage Flasks!  Be sure to sign up for our newsletter to stay up to date with our latest designs, discounts, and giveaways!\r\n\r\nNEWSLETTER SIGNUP LINK:\r\nhttp://eepurl.com/FP_fT\r\n\r\n-Shipping-\r\nOur items typically ship within 2 business days and have an estimated delivery time of 2-5 business days within the United States.  If you purchased a custom item, a convo will be sent to you shortly to request more information or to approve a mock up.  Please let us know if you have any questions.  \r\n\r\n-International Shipping-\r\nInternational shipments have an estimated delivery time of 6-10 business days from the time of shipment.  Please note that the shipping time may vary due to customs policies in your country.  International customers are responsible for all Destination Duties, Taxes, and Import Charges.\r\n\r\nAmy and Tyler Fisk\r\nLiquid Courage\r\n888-959-2870\r\nsales@liquidcourageflasks.com",
"digital_sale_message": null,
"last_updated_tsz": 1445455885,
"listing_active_count": 503,
"login_name": "LiquidCourage",
"accepts_custom_requests": true,
"policy_welcome": "Hello and welcome to our shop! My name is Amy, and my husband, Tyler and I are the owners and creators of Liquid Courage. We have been selling online since 2003. Recently, we decided to make the leap from selling items made by others to selling items that we make. We have been goofing around making all sorts of arts, crafts, scrapbooks, and clothing for many years and decided to combine my hobby with my online business experience. \r\n\r\nTyler has an Accounting degree from Tennessee Technological University, and I have a bachelor&#39;s degree in Marketing and an MBA in Accounting from TTU as well.  Upon graduating, we tried &quot;real, grown-up jobs&quot; - Tyler as a general manager at a greenhouse manufacturing company, and I as a staff accountant for a nationwide manufacturing company.  We spent a couple of years working for &quot;the man&quot;...at a desk eight hours a day...fifty weeks a year.\r\n\r\nWe finally decided to follow our dream of becoming entrepreneurs, pursue our passion, and determine our own future with hands on approach. We chose the path less traveled by, and that has made all the difference.\r\n\r\nPlease don&#39;t hesitate to ask if you have any questions or would like a custom item.\r\n\r\n(888) 959-2870 (M-F 9am - 5pm Eastern)\r\nor\r\nConvo us anytime! \r\n\r\nCheers! \r\nTyler and Amy",
"policy_payment": "We accept PayPal, credit cards, Etsy gift cards, checks, and money orders.",
"policy_shipping": "Flasks ship within 1-2 business days unless otherwise noted in the shop header. Items are shipped via USPS Priority Mail or First Class Mail and have an estimated arrival time of 2-5 business days from the time of shipment.\r\n\r\nINTERNATIONAL SHIPPING:\r\n\r\nWe ship internationally via USPS Priority Mail which has an estimated delivery time of 6-10 business days.  International customers are responsible for all Destination Duties, Taxes, and Import Charges.  Please note the shipping time may vary due to customs policies in your country.\r\n\r\nCUSTOM ORDERS:\r\n\r\nWe do not ship custom orders until the buyer approves the custom mock up.",
"policy_refunds": "Please contact us if you have an issue with any part of the transaction, and we will work it out. If you are unsatisfied in any way, please contact us first and allow us the chance to resolve the issue.\r\n\r\nReturns:  We offer returns less initial shipping, and we do not refund return shipping charges.",
"policy_additional": "NEW & IMPROVED FLASK MAKING PROCESS:\r\n\r\nLiquid Courage flasks are handmade creations, and we have spent over 3 years tweaking and improving the design process.  We design the patterns in Photoshop, print them on high quality vinyl, cut them to size, center the designs on the flask, and adhere the designs to the flasks.  \r\n\r\nFEEDBACK:\r\n\r\nFeedback is a way to establish a reputation of trust for buyers, sellers, and the Etsy marketplace and directly affects a member&#39;s reputation, so positive feedback is always appreciated! :)  If for any reason you are unsatisfied, please contact us before leaving feedback to allow us the opportunity to resolve the issue.\r\n\r\nFLASK SIZE:\r\n\r\n6 Ounce Flask\r\nDimensions: 3.75&quot; Length, 1.00&quot; Width, 4.50&quot; Height",
"policy_seller_info": null,
