"description": "Rocks Glass - Custom Glass Etched - Etched Glass - Custom Glass Etching - Sandblasted Glass - Personalized Beer Glasses - Whiskey Glass\n\nThe dimensions of this pint glass are as follows:\n\nHeight - 3.75 inches\nDiameter (across) - 3 inches at the top\n\nPlease specify what you would like your personalized rocks glass to contain and your font choice, either in the note section of the order, or via Etsy Conversation.\n\nAll of my glass etching is done using a professional sand carving system, not your everyday garage sandblaster.  Each item is designed, stenciled, and sand carved by me, using my artist style glass etching system.  I never etch glass using chemicals, therefore you will be able to &quot;feel&quot; the etch in your glass. The appearance of the glass etching will be a smooth, milky white, even finish.  \n\nMy Dailey Creations specializes in custom glass etching, such as unique glass vases, custom cat and dog treat jars, custom wine glasses, custom shot glasses, custom beer glasses, pilsner glasses, beer mugs and bottle openers.  If you have an idea, phrase, or story for a custom etched glass piece, don&#39;t hesitate to contact me.  It would be my pleasure to help you design your customized gift.  \n\nPersonalization is also available on any existing or new piece.  If you are in need of personalized wedding gifts, personalized groomsmen gifts, personalized bridesmaids gifts, personalized party favors, personalized glasses, or barware, send me your details, and I would be happy to work with you.  Personalized glassware is a great gift idea for any occasion.  \n\nWant a different shaped custom bar glass? Check out my other glasses here.   https://www.etsy.com/shop/MyDaileyCreations?section_id=17581133&ref=shopsection_leftnav_9\n\nWant to learn more about me and My Dailey Creations? Click here. https://www.etsy.com/shop/MyDaileyCreations/about?ref=shopinfo_about_leftnav\n\nPlease review my store policies, and ask any questions prior to purchasing. Store policies can be found here. https://www.etsy.com/shop/MyDaileyCreations/policy?ref=shopinfo_policies_leftnav\n\nShipping charges are an estimate. I charge exact shipping only to your destination. Since most of my items cannot go first class, the charges vary by location. If this charge is overstated for your location, I will promptly refund you the difference. \n\nI will consider international shipping after researching your location. Due to the fragile nature of my items, this may not always be available. Please contact me first if you are international.",
