"title": "Unique and Unusual Handmade Gemstone Jewelry",
"announcement": "Anokha is an Urdu word I love that means &quot;Unique or Unusual&quot; which I think describes my jewelry. Each piece is handmade by me using natural gemstones, pearls and handcrafted glass beads. \r\n,\r\nPlease let me know if you have any questions or requests.  I would be happy to add on or adjust something I have posted to match your size requirements. I am also able to fill custom orders!\r\n\r\nJewelry purchased will be carefully packaged in a white gift box, wrapped and tied with a black grosgrain ribbon and include a pretty organza gift bag for jewelry storage and safekeeping.\r\n\r\nThank you for stopping by my Etsy shop!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you so much for purchasing one of my pieces and choosing Anokha. I greatly appreciate your business so let me know if I can assist in any way! Your piece will ship out in 1-3 business days and you will receive an email confirmation with tracking once your jewelry ships.  \r\n\r\n Enjoy!\r\nAhnna\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1445265633,
"listing_active_count": 60,
"login_name": "Ahnnaw",
"accepts_custom_requests": true,
"policy_welcome": "Thank you for stopping by my online Etsy boutique!  I originally saw the name Anokha in a Vogue article years ago and saved it hoping to use it for my future shop.  It is the Urdu word that means &quot;Unique or Unusual&quot; which I think describes many of my pieces and overall asthetic. Jewelry is one of the great ways for each of us to express our individuality and add flair, depending on how we feel that day or what we want to present to the world.\r\n\r\nEach piece is handmade by me, in a smoke free environment using semiprecious gemstones and a variety of metals. Most pieces are one of a kind, but I may be able to duplicate a past piece that has sold or is reserved.\r\n\r\nPlease let me know if you have any questions or requests.  I would be happy to add on or adjust something I have posted to your size requirements. I am also able to fill custom orders.\r\n\r\n*All items sold will be carefully packaged, wrapped and tied with a ribbon.\r\n\r\nThank you so much for stopping by my shop!",
"policy_payment": "I accept Paypal, Etsy Gift Cards, Checks and Money Orders.  If you do use check or money order, I will ship your purchase after receipt and clearance of the payment.",
"policy_shipping": "Hi, I charge a flat rate of $5.50 for USPS shipping for one or multiple items going to a US location.  International buyers will be charges $6.50 for the same. Upgrades are available including insurance at an additional cost and can be chosen at checkout.  Please convo me with any questions or concerns!",
"policy_refunds": "100% Satisfaction Guarantee. Return any item within 5 days of receipt for full refund or exchange (excluding shipping costs). Custom orders are not returnable, however I will work with you on any issue so that you are happy with your jewelry purchase!\r\n \r\nIf an item does break, please contact me and we can discuss options.",
