"policy_welcome": "Welcome! Thanks for stopping by Milso Made. I specialize in creating custom prints on both natural burlap and linen paper. Each print is custom cut to 8.5 x 11&quot; and designed to fit in an 8 x 10&quot; photo frame. Some items are available for digital download as well! I enjoy custom designs so if you have any ideas don&#39;t hesitate to ask. \r\n\r\nPlease feel free to contact me at MilsoMade@yahoo.com with any questions! I appreciate any and all suggestions and look forward to hearing from you. Thank you!",
"policy_payment": "Milso Made accepts Credit Cards, PayPal, and Etsy Gift Cards. Payment is due at the time of checkout.\r\n\r\n\r\n",
"policy_shipping": "Each print is custom made to order and will generally take 1-2 business days to complete. If you choose to have a custom order, please be sure to include all information and e-mail address so that we can send you a proof before printing. After you have confirmed the print the item will ship within 1 business day. \r\n\r\nDomestic Orders:\r\nWe ship via USPS First Class and tracking details are included for shipping within the United States. When your artwork ships, you will receive an email with USPS tracking details.\r\n\r\nRush Order: \r\nFor an additional charge we can ship your item(s) expedited. To choose this service, simply add the &quot;Rush Order&quot; listing to your cart when you checkout. Most Domestic orders arrive within 1-2 business days while International orders arrive between 6-10 business days. \r\n\r\nInternational Orders:\r\nAll International orders will ship with USPS International First Class Mail. Shipping times vary therefore please allow 2-4 weeks to receive your item(s). \r\n\r\nWhere applicable, import duties, taxes, and other charges are the buyer&#39;s responsibility. Please check with your country&#39;s customs office to determine what the additional costs will be prior to making your purchase. If you have any questions regarding customs please contact me and I will do my best to answer your questions. ",
"policy_refunds": "Milso Made cannot offer a refund on any Digital Downloads. If you believe you ordered this in error please contact me at your earliest convenience.\r\n\r\nIf you are not 100% satisfied with your order I will issue you a refund for the full amount, including shipping costs. \r\n",
"policy_additional": "If you would like a custom order please contact me and I will do my best to make your vision a reality!",
